package leetcode

import "testing"

func TestCase1(t *testing.T) {
	var nums []int = []int{3, 2, 3}
	var result = majorityElement(nums)
	if result != 3 {
		t.Fatalf(`majorityElement(%d) should have returned 3, but the result was %d.`, nums, result)
	}
}

